import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Typography } from '@mui/material';
import { styled } from '@mui/system';
const RootContainer = styled('div')({
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
});

const Title = styled(Typography)(({ theme }) => ({
    marginBottom: theme.spacing(4),
    fontWeight: 'bold',
    fontSize: '2rem',
}));

const ButtonContainer = styled('div')({
    margin: theme.spacing(1),
    width: '200px',
});

const Home = () => {
    return (
        <RootContainer>
            <Title variant="h1">
                Welcome to the Homepage!
            </Title>
            <ButtonContainer>
                <Button
                    component={Link}
                    to="/login"
                    variant="contained"
                    color="primary"
                >
                    Go to Login
                </Button>
            </ButtonContainer>
            <ButtonContainer>
                <Button
                    component={Link}
                    to="/signup"
                    variant="contained"
                    color="primary"
                >
                    Go to Signup
                </Button>
            </ButtonContainer>
            <ButtonContainer>
                <Button
                    component={Link}
                    to="/catalogue"
                    variant="contained"
                    color="primary"
                >
                    Go to Catalogue
                </Button>
            </ButtonContainer>
        </RootContainer>
    );
};

export default Home;
